    return (
        <div className="project-container">
            { img != null ? <div className="project-img-container"><img className="project-ss" src={img} alt={title}/></div> : null }
            <div className="project-content">
                <h3>{title}</h3>
                <p>Technologies:
                    {tech.map((techEl, key) => <span key={key}>{techEl.join(",")}</span>)}</p>
                <p>{content}</p>
            </div>
        </div>
    );
}

export default Project;
